(1, 2, '2023-04-05', '2023-04-08', 'Dear Ansar Khan,\r\n\r\nI am writing to request a change in our scheduled appointment from 2023-04-04 / 03:15:00 - 03:30:00 to new date . Unfortunately, i wont be able to come. I am hoping we can find a mutually convenient time to reschedule.\r\n\r\nPlease let me know if [new date and time] would work for you. If not, please suggest a few other dates and times that would be convenient for you.\r\n\r\nThank you for your cooperation in this matter.\r\n\r\nSincerely,\r\nali', 1, '2023-04-03 01:36:59', '2023-04-03 01:36:59'),
(2, 3, '2023-04-05', '2023-04-07', 'Dear Ansar Khan,\r\n\r\nI am writing to request a change in our scheduled appointment from 2023-04-04 / 03:15:00 - 03:30:00 to new date . Unfortunately, i wont be able to come. I am hoping we can find a mutually convenient time to reschedule.\r\n\r\nPlease let me know if [new date and time] would work for you. If not, please suggest a few other dates and times that would be convenient for you.\r\n\r\nThank you for your cooperation in this matter.\r\n\r\nSincerely,\r\nShahab Shahkoor', NULL, '2023-04-03 05:03:06', '2023-04-03 05:03:06');
