(62, 1, '78949895464', '789', '654946496464', '654', '<p>Saima Heaven, Opp. New Dhora Jee Colony, Block-4, Gulshan-e-Iqbal, Karachi.&nbsp;<br></p>', 'BDS, RDS, FCPS', '<p>By studying dentistry, orthodontics and then teaching these to undergraduate, postgraduate students and practicing dentistry for around 20 years I can fully enhance my capabilities of understanding the human smile and acknowledging it. This field can lead me into a direction of creating happiness and smile on the face of the people belongs from all walks of life because it&amp;#39;s natural phenomena or wish of every human to look beautiful.</p>', '<ul><li>Supervisor And Examiner CPSP | MCPS and FCPS</li><li>Incognito Certified (Lingual Orthodontics)</li><li>Invisalign Certified (Clear Aligners)</li><li>BDS, FCPS (Orthodontics)</li><li>Diploma in Implantology from Germany and South Korea</li></ul>', '<p>Professor, Karachi Medical &amp;amp;Dental College</p><p>Consultant Dental Surgeon and Orthodontist 20 years</p>', '<p>Working as Professor and Head of Orthodontics Department in Karachi Medical and Dental College and Abbasi Shaheed Hospital and responsible for the following.</p><ul><li><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span>Head of Orthodontics Department.</span></li><li><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span>Teaching Final Year BDS Students, House Officers, Senior House Officers and Dental Officers</span></li><li><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span>Consultant Dental Surgeon</span></li><li><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span>Diagnosis, treatment planning, treatment and follow up of patients.</span></li><li><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span>Post Graduate Supervisor and Examiner CPSP.</span></li><li><span style=\"white-space: normal;\"><span style=\"white-space:pre\">	</span>Conducted several lectures and Workshops</span></li></ul>', '<ul><li><span style=\"font-size: 1rem;\">Member Pakistan Association of Orthodontists</span></li><li><span style=\"font-size: 1rem;\">Member Academy of Straight Wire and Functional Orthodontics</span></li><li><span style=\"font-size: 1rem;\">Member American Association of Orthodontics</span></li><li><span style=\"font-size: 1rem;\">Member World Federation of Orthodontics</span></li><li><span style=\"font-size: 1rem;\">Member Pakistan Dental Association</span></li><li><span style=\"font-size: 1rem;\">Treasurer Pakistan Association of Orthodontists 2013.</span></li><li><span style=\"font-size: 1rem;\">Chairman Trade and Registration Pakistan Dental Association Conference 2012.</span></li><li><span style=\"font-size: 1rem;\">General Secretary Pakistan Association of Orthodontist International Conference 2011</span></li><li><span style=\"font-size: 1rem;\">Secretary crisis management Asia Pacific Dental Congress</span></li><li><span style=\"font-size: 1rem;\">Member Editorial board, Journal Pakistan Association of Orthodontists</span></li><li><span style=\"font-size: 1rem;\">General Secretary Pakistan Dental Association (Sindh)</span></li></ul>', '1686739942.png', 0),
(63, 1, '+1 (959) 987-4964', '0300', '+1 (715) 867-8184', '0300', '<p><b>Address </b><u>Details</u></p>', 'BSD', '<p><i>Biographical </i><span style=\"font-family: &quot;Arial Black&quot;;\">Sketch</span></p>', '<p>Education and Fellowship</p>', '<p><span style=\"color: rgb(133, 135, 150); font-family: Nunito, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\">Speciality Interests:</span><br></p>', '<p><span style=\"color: rgb(133, 135, 150); font-family: Nunito, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\">Research &amp; Publications</span><br></p>', '<p><span style=\"color: rgb(133, 135, 150); font-family: Nunito, -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, &quot;Helvetica Neue&quot;, Arial, sans-serif, &quot;Apple Color Emoji&quot;, &quot;Segoe UI Emoji&quot;, &quot;Segoe UI Symbol&quot;, &quot;Noto Color Emoji&quot;;\">Professional Memberships</span><br></p>', '1715769448.jpg', 1);
