INSERT INTO `specialities` (`id`, `speciality`, `description`, `image`) VALUES
(1, 'ROOT CANAL TREATMENT', 'A root canal is a treatment used to repair and save atooth that is badly decayed or becomes infected. During aroot canal procedure, the nerve and pulp are removed and the inside of thetoothis cleaned and sealed.', '1685963342.png'),
(2, 'TOOTH CLEANING', 'With the small mirror to guide them, thedentalhygienist uses a Scaler to get rid of plaque and tartar around your gum line, as well as in between yourteeth. You\'ll hear scraping, but this is normal. Teeth cleaning is part of oral hygiene and involves the removal of dental plaque from teeth with the intention of preventing cavities, gingivitis, and periodontal disease', '1685963344.png'),
(3, 'ORTHODONTICS', 'Orthodontia, also calledorthodonticsanddentofacial orthopedics, is a specialty ofdentistrythat deals with the diagnosis, prevention and correction of malpositioned teeth and jaws.', '1685963345.png'),
(4, 'COSMETIC DENTAL JEWELLERY', 'Just like body art and body piercings, tooth jewelry is the new fashion wave to hit the scene. These are jewelry items worn for cosmetics and sometimes status symbol reasons on ones teeth. A simple diamond or gold stud or a crystal is attached to tooth service. The procedure is painless.', '1685963348.png'),
(5, 'DENTAL IMPLANT', 'A dental implant is used to support one or more false teeth. It is a titanium screw that can replace the root of a tooth when it fails. Just like a tooth root, it is placed into the jawbone to support adental prosthesissuch as acrown,bridge,denture, facial prosthesis or to act as anorthodontic anchor', '1685963346.png'),
(6, 'DENTAL SURGERIES', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has', '1685963349.png'),
(7, 'DENTURES', 'There are three main ways to replace missing teeth. The first is with a removable false tooth (or teeth) - called a partial denture. The second is with a fixed bridge. A bridge is usually used when there are fewer teeth to replace, or when the missing teeth are only on one side of the mouth. The third way is by the use of dental implants\'. This is where an artificial root is placed into the bone of the jaw and a crown or bridge placed on top of this', '1685963347.png'),
(8, 'COSMETIC FILLINGS AND RESTORATION', 'With advances in technology in tooth colored restorative material, we can restore the beauty and function of a healthy set of teeth.We use state-of-the-art tooth-colored resin and porcelain materials, so that even teeth that have been heavily restored with unsightly and even older materials that are broken down can be made to look pristine again.', '1685963343.png');
